import React, { useState } from 'react'
import { useNavigate } from 'react-router-dom'
import '../styles/Header.css'
const Header = () => {
  const [signup, nextsignup]= useState('false');
  const navigate=useNavigate();
  const sign=()=>{
   navigate('/Signup');
  }
  const login=()=>{
    navigate('/Login');
  }
  return (
    <div className='header'>
        <div className='title'>Blogify</div>
        <div className='element'>
            <input type="search" placeholder='What are you lookin for' name="" id="" />
            <button>Search</button>
        </div>

        <div className='signup'>
           {signup} <button  onClick={sign} className='sign'>Sign Up</button>
            <button onClick={login} className='login'>Login</button>
        </div>
    </div>
  )
}

export default Header
